import User from './user/user'
import Film from './film/film'
import Planet from './planet/planet'

const Root = ({ route, children }) => {
    return (
        <Configuration>
            {renderRoutes(route.routes)}        
        </Configuration>
    );
};

export const routes = [
    {
      component: Root,
      routes: [        
        {
            path: "/films",
            exact: true,
            component: Film
        },
        {
            path: "/planets",
            exact: true,
            component: Planet
        },
        {
            path: "/",
            exact: true,
            component: User
          }
      ]
    }
  ];
